import React from "react";

const LabelsTable = ({label}) => {
  return (
    <div>
      <tbody style={{ background: "#fff" }}>
        <tr>
          <td>
            <a
              href="#"
              className="issueLabel"
              style={{
                padding: "2px 12px",
                fontSize: "14px",
                fontColor: `${label.font_color}`,
                background: `${label.bg_color}`,
              }}
            >
              {label.name}
            </a>
          </td>
          <td>
            <a
              href="#"
              style={{
                color: "#57606a !important",
                fontSize: "14px",
              }}
            >
              {label.description}
            </a>
          </td>
        </tr>
      </tbody>
    </div>
  );
};

export default LabelsTable;
